import React, { useState } from 'react';
import './monitor.css';
import logo from '../logo1.png'
import axios from 'axios';
const Monitor = () => {
    const [doctorRoom, setDoctorRoom] = useState(sampleData);
    const [receptionRoom, setReceptionRoom] = useState(sampleData);
    const [ECGRoom, setECGRoom] = useState(sampleData);
    const [treatmentRoom, setTreatmentRoom] = useState(sampleData);
    const [triageRoom, setTriageRoom] = useState(sampleData);
    useEffect(() => {
        const doctorRoomUrl = 'http://localhost:3001/main-table/doctorQueue';
        const receptionRoomUrl = 'http://localhost:3001/main-table/receptionQueue';
        const ecgRoomUrl = 'http://localhost:3001/main-table/ecgQueue';
        const treatmentRoomUrl = 'http://localhost:3001/main-table/treatmentQueue';
        const triageRoomUrl = 'http://localhost:3001/main-table/triageQueue';



        axios.get(doctorRoomUrl)
            .then(response => {
                setDoctorRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });

        axios.get(receptionRoomUrl)
            .then(response => {
                setReceptionRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
        axios.get(ecgRoomUrl)
            .then(response => {
                setECGRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
        axios.get(treatmentRoomUrl)
            .then(response => {
                setTreatmentRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
        axios.get(triageRoomUrl)
            .then(response => {
                setTriageRoom(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });
    });







    return (
        <>
            <div className='monitorAllPage'>
                <div className='logoImgCont'>
                    <img className='logoImg' src={logo} alt='logo'></img>
                </div>
                <div className='monitor'>


                    <div className='roomMonitor'>
                        <div className='roomName'>חדר רופא</div>
                        <div className='currentPatientCont'>
                            <span className='detailTitle'>מטופל נוכחי</span>
                            <span className='currentPatientDetails'>{doctorRoom[0].uniqueNumber}</span>
                        </div>
                        <div className='morePatientsCont'>
                            <span className='detailTitle'>הבאים בתור</span>
                            <span className='nextPatientDetails'>{doctorRoom[1].uniqueNumber},{doctorRoom[2].uniqueNumber},{doctorRoom[3].uniqueNumber}</span>
                        </div>
                        <div className='queueSizeCont'>
                            <span className='detailTitle'>מספר ממתינים</span>
                            <span className='queueSizeDetails'>15</span>
                        </div>
                    </div>



                    <div className='roomMonitor'>
                        <div className='roomName'>חדר אקג</div>
                        <div className='currentPatientCont'>
                            <span className='detailTitle'>מטופל נוכחי</span>
                            <span className='currentPatientDetails'>{ECGRoom[0].uniqueNumber}</span>
                        </div>
                        <div className='morePatientsCont'>
                            <span className='detailTitle'>הבאים בתור</span>
                            <span className='nextPatientDetails'>{doctorRoom[1].uniqueNumber}, {doctorRoom[2].uniqueNumber}, {doctorRoom[3].uniqueNumber}</span>
                        </div>
                        <div className='queueSizeCont'>
                            <span className='detailTitle'>מספר ממתינים</span>
                            <span className='queueSizeDetails'>2</span>
                        </div>
                    </div>
                    <div className='roomMonitor'>
                        <div className='roomName'>קבלה</div>
                        <div className='currentPatientCont'>
                            <span className='detailTitle'>מטופל נוכחי</span>
                            <span className='currentPatientDetails'>{receptionRoom[0].uniqueNumber}</span>
                        </div>
                        <div className='morePatientsCont'>
                            <span className='detailTitle'>הבאים בתור</span>
                            <span className='nextPatientDetails'>{doctorRoom[1].uniqueNumber}, {doctorRoom[2].uniqueNumber}, {doctorRoom[3].uniqueNumber}</span>
                        </div>
                        <div className='queueSizeCont'>
                            <span className='detailTitle'>מספר ממתינים</span>
                            <span className='queueSizeDetails'>8</span>
                        </div>
                    </div>

                    <div className='roomMonitor'>
                        <div className='roomName'>חדר טיפולים</div>
                        <div className='currentPatientCont'>
                            <span className='detailTitle'>מטופל נוכחי</span>
                            <span className='currentPatientDetails'>{treatmentRoom[0].uniqueNumber}</span>
                        </div>
                        <div className='morePatientsCont'>
                            <span className='detailTitle'>הבאים בתור</span>
                            <span className='nextPatientDetails'>{doctorRoom[1].uniqueNumber},{doctorRoom[2].uniqueNumber},{doctorRoom[3].uniqueNumber}</span>
                        </div>
                        <div className='queueSizeCont'>
